$(document).ready(function() {
    switch (getSearchEngine()) {
        case '1':
            $("#banner").css('width', "272px")
            $("#banner").css('height', "92px")
            $("#banner").css('background-image', "url('data:image/png;base64,')")
            $("#hint").text("Write URL or search in Google...")
            break;
        case '2':
            $("#banner").css('width', "216px")
            $("#banner").css('height', "61px")
            $("#banner").css('margin-bottom', "10px")
            $("#banner").css('background-position', "left 0")
            $("#banner").css('background-image', "url('data:image/png;base64,')")
            $("#hint").text("Write URL or search in Cốc Cốc...")
            break;
        case '3':
            $("#banner").css('width', "250px")
            $("#banner").css('height', "200px")
            $("#banner").css('background-image', "url('data:image/svg+xml;base64,')")
            $("#hint").text("Write URL or search in DuckDuckGo...")
            break;
        case '4':
            $("#banner").css('width', "250px")
            $("#banner").css('height', "97px")
            $("#banner").css('background-image', "url('data:image/png;base64,')")
            $("#hint").text("Write URL or search in Bing...")
            break;
        case '5':
            $("#banner").css('width', "320px")
            $("#banner").css('height', "61px")
            $("#banner").css('background-image', "url('data:image/png;base64,')")
            $("#hint").text("Write URL or search in Yahoo!...")
            break;
        case '6':
            $("#banner").css('width', "400px")
            $("#banner").css('height', "200px")
            $("#banner").css('background-image', "url('data:image/png;base64,')")
            $("#hint").text("Write URL or search in Yandex...")

            break;
    }

    if ($('.md-input .text').val().length > 0) {
        $('.md-input .hint').addClass("md-input-animate-hint");
    }
    $('.md-input .text').focus(function() {

        var textLength = $('.md-input .text').val().length;
        if (textLength <= 0) {
            $('.md-input .hint').addClass("md-input-animate-hint");
            $('.md-input .hint').css('color', '#2196F3')
            $('.md-input .hint').css('opacity', '1')
        }
        $('.md-input .divider2').addClass("md-input-animate-divider");
    });
    $('.md-input .text').focusout(function() {
        var textLength = $('.md-input .text').val().length;
        if (textLength <= 0) {
            $('.md-input .hint').removeClass("md-input-animate-hint");
            $('.md-input .hint').css('color', '#444')
            $('.md-input .hint').css('opacity', '0.6')
        }
        $('.md-input .divider2').removeClass("md-input-animate-divider");
    });

    function isURL(s) {
        var regexp = /[a-zA-Z-0-9]+\.[a-zA-Z-0-9]{2,3}/;
        return regexp.test(s);
    }
    $('.text').keypress(function(e) {
        if (e.which == 13) {
            if (!$('.text').val().startsWith("kt-browser://")) {
                if (isURL($('.text').val())) {
                    if ($('.text').val().startsWith("http://") || $('.text').val().startsWith("https://") || $('.text').val().startsWith("file://")) {
                        window.location.href = $('.text').val();
                    } else {
                        window.location.href = "http://" + $('.text').val()
                    }
                } else {
                    switch (getSearchEngine()) {
                        case '1':
                            window.location.href = 'https://www.google.com/search?q=' + $('.text').val();
                            break;
                        case '2':
                            window.location.href = 'http://coccoc.com/search#query=' + $('.text').val();
                            break;
                        case '3':
                            window.location.href = 'https://duckduckgo.com/?q=' + $('.text').val();
                            break;
                        case '4':
                            window.location.href = 'https://www.bing.com/search?q=' + $('.text').val();
                            break;
                        case '5':
                            window.location.href = 'https://search.yahoo.com/search?p=' + $('.text').val();
                            break;
                        case '6':
                            window.location.href = 'https://www.yandex.com/search/?text=' + $('.text').val();
                            break;
                    }
                }
            } else {
                window.location.href = $('.text').val();
            }

            return false;
        }
    });

    function makeRippleMenuItem(menuItem, e) {
        var relX = e.pageX - $(menuItem).offset().left;
        var relY = e.pageY - $(menuItem).offset().top;
        Ripple.makeRipple($(menuItem), relX, relY, $(menuItem).width(), $(menuItem).height(), 500, 0);
    }

    $('.bookmarks a').mousedown(function(e) {
        makeRippleMenuItem($(this), e);
    });
    var marginRight = 8;
    $('.bookmarks').css('width', $('.bookmarks a').width() * 3 + 3 * marginRight);
});